import React from 'react';

class TestCode extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          posts: []
        }
      }

      componentDidMount = () => {
        this.getData();
      }

      getData = () => {
        axios.get("testdatabase.js")
          .then((response) => {
            const data = response.data;
            this.setState({ posts: data })
            console.log("Data has been received!");
          })
          .catch(() => {
            console.log("Error!")
          })
      }

    render() {
        return (
            <div>
            </div>
        )
    }
}

export default TestCode;
